import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import axios from "axios";
import DynamicForm from "./DynamicForm"; // Adjust the import path as necessary
import ViewContent from "./ViewContent"; // Adjust the import path as necessary

const App = () => {
  const [users, setUsers] = useState([]);
  const [comments, setComments] = useState([]);
  const [canteenMenu, setCanteenMenu] = useState([]);
  const [events, setEvents] = useState([]);
  const [meetings, setMeetings] = useState([]);
  const [error, setError] = useState(null);
  const [selectedEntries, setSelectedEntries] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const userResponse = await axios.get("http://localhost:3000/users");
        setUsers(userResponse.data);

        const commentResponse = await axios.get(
          "http://localhost:3000/comments"
        );
        setComments(commentResponse.data);

        const canteenMenuResponse = await axios.get(
          "http://localhost:3000/canteenMenu"
        );
        setCanteenMenu(canteenMenuResponse.data);

        const eventResponse = await axios.get("http://localhost:3000/events");
        setEvents(eventResponse.data);

        const meetingResponse = await axios.get(
          "http://localhost:3000/meetings"
        );
        setMeetings(meetingResponse.data);
      } catch (error) {
        setError(error);
      }
    };

    fetchData();
  }, []);

  const handleAddToScreen = () => {
    // Logic to add selected entries to the screen
    console.log("Selected entries:", selectedEntries);
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/add">Add Data</Link>
            </li>
            <li>
              <Link to="/view">View Content</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route
            path="/"
            element={
              <div>
                <h1>Data from API</h1>
                {error && <p>Error fetching data: {error.message}</p>}
                <h2>Users</h2>
                <ViewContent
                  data={users}
                  selectedEntries={selectedEntries}
                  setSelectedEntries={setSelectedEntries}
                />
                <h2>Comments</h2>
                <ViewContent
                  data={comments}
                  selectedEntries={selectedEntries}
                  setSelectedEntries={setSelectedEntries}
                />
                <h2>Canteen Menu</h2>
                <ViewContent
                  data={canteenMenu}
                  selectedEntries={selectedEntries}
                  setSelectedEntries={setSelectedEntries}
                />
                <h2>Events</h2>
                <ViewContent
                  data={events}
                  selectedEntries={selectedEntries}
                  setSelectedEntries={setSelectedEntries}
                />
                <h2>Meetings</h2>
                <ViewContent
                  data={meetings}
                  selectedEntries={selectedEntries}
                  setSelectedEntries={setSelectedEntries}
                />
                <button onClick={handleAddToScreen}>Add to Screen</button>
              </div>
            }
          />
          <Route path="/add" element={<DynamicForm />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;

const formatDate = (dateString) => {
  const options = { year: "numeric", month: "2-digit", day: "2-digit" };
  return new Date(dateString).toLocaleDateString(undefined, options);
};
